description:
The cute and Scottish Karen Gillan, companion of the wussiest Doctor Who ever, doing an interview on the Late Late Show with Craig Ferguson July 26, 2011. She is wearing a tablecloth made into a mini dress. Notable is the best &quot;awkward pause&quot; ever. Ever.

Note: There are a few video glitches starting 8:35.

720p mkv video converted from 1080i mpeg2. Two-pass conversion with Freemake Video Converter.


